import * as React from 'react';
import LinearProgress, { linearProgressClasses } from '@mui/material/LinearProgress';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';
import { useTheme } from '@mui/material/styles';
import MobileStepper from '@mui/material/MobileStepper';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import Typography from '@mui/material/Typography';
import {Link} from "react-router-dom";

function Survey() {
  const theme = useTheme();
  const [activeStep, setActiveStep] = React.useState(0);

  const handleNext = () => {
  setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
  setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const steps = ['brandName', 'brandNameMean', 'business', 'vibe', 'select'];

    const renderStep = () => {
      let content = null;
      switch (activeStep) {
          case 0:
            content = (
              <div className="p-lr-8">
                  <h1>브랜드명</h1>
                  <span className="description-span">CI /BI 에 적용될 브랜드명 또는 서비스명을 입력해주세요.</span>
                  <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="브랜드명 입력" variant="standard" />
                    </Box>
                  </Stack>
              </div>
            );
            break;
          case 1:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="브랜드명 의미 입력" variant="standard" />
                    </Box>
                  </Stack>
                </div>
              );
            break;
          case 2:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                  <Box
                    component="form"
                    sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                    noValidate
                    autoComplete="off">
                    <TextField id="standard-basic" label="관련 비즈니스 입력" variant="standard" />
                  </Box>
                </Stack>
              </div>
            );
          break;
          case 3:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="원하는 로고 분위기" variant="standard" />
                    </Box>
                  </Stack>
                </div>
              );
            break;
          case 4:
            content = (
              <div className="p-8">
                <div className="m-8">원하는 스타일을 선택해주세요!</div>
                  <Stack direction="row">
                </Stack>
              </div>
            );
          break;
        default:
          content = <div>Error</div>;
          break;
      }
      return content;
    };

  return (
    /*<div className="parent">
        <div className="child">
            <div className="survey text-center">
                <div className="progress-div">
                <MobileStepper
                    variant="progress"
                    steps={7}
                    position="static"
                    activeStep={activeStep}
                    sx={{ flexGrow: 1 }}
                    nextButton={
                      <Button size="small" onClick={handleNext} disabled={activeStep === 6}>
                        Next
                        {theme.direction === 'rtl' ? (
                          <KeyboardArrowLeft />
                        ) : (
                          <KeyboardArrowRight />
                        )}
                      </Button>
                    }
                    backButton={
                      <Button size="small" onClick={handleBack} disabled={activeStep === 0}>
                        {theme.direction === 'rtl' ? (
                          <KeyboardArrowRight />
                        ) : (
                          <KeyboardArrowLeft />
                        )}
                        Back
                      </Button>
                    }
                  />
                </div>
                <div className="content-div">
                    {renderStep()}
                </div>
                <div className="button-div">
                    <Link to={"/Survey"}>
                        <Button className="startBt f-right" variant="contained" color="pupleblue">START</Button>
                    </Link>
                </div>
            </div>
        </div>
    </div>*/
      <div className="parent">
          <div className="child">
              <div className="survey text-center">
                  <div className="progress-div">
                      <Stepper activeStep={activeStep}>
                          {steps.map((label, index) => {
                              const stepProps = {};
                              const labelProps = {};
                              return (
                                  <Step key={label} {...stepProps}>
                                      <StepLabel {...labelProps}></StepLabel>
                                  </Step>
                              );
                          })}
                      </Stepper>
                  </div>
                  <div className="content-div">
                      {activeStep === steps.length ? (
                          <React.Fragment>
                              생성중이에요, 잠시만 기다려주세요 !
                          </React.Fragment>
                      ) : (
                          <React.Fragment>
                              <Typography sx={{ mt: 2, mb: 1 }}>{renderStep()}</Typography>
                              <Box sx={{ display: 'flex', flexDirection: 'row', pt: 2 }}>
                                  <Button
                                      color="inherit"
                                      disabled={activeStep === 0}
                                      onClick={handleBack}
                                      sx={{ mr: 1 }}
                                  >
                                      Back
                                  </Button>
                                  <Box sx={{ flex: '1 1 auto' }} />
                                  <Button onClick={handleNext}>
                                      {activeStep === steps.length - 1 ? 'Finish' : 'Next'}
                                  </Button>
                              </Box>
                          </React.Fragment>
                      )}
                  </div>
                  <div className="button-div">
                      <Link to={"/Survey"}>
                          <Button className="startBt f-right" variant="contained" color="pupleblue">START</Button>
                      </Link>
                  </div>
              </div>
          </div>
      </div>
  );
}

export default Survey;
